import React, {Component} from 'react';
import TodoItem from './TodoItem';

class TodoList extends Component {
    render() {
        const {todos} = this.props;
        const todoList = todos.map(
            todo => (
                <TodoItem
                 Key= {todo.id}
                 done = {todo.done}>
                 {todo.text}
                 </TodoItem>                
            )
        )
        return (
            <div>
                <TodoItem/>
            </div>
        )
    }
}

export default TodoList;
